import React, { Component } from 'react';
import { Card, Icon , Image} from 'semantic-ui-react'
// import './test_tweet.json'
import testTweet from './testTweet'
import newTweet from './newTweet'

class Test extends Component {  

  render() {
    var at = "@";
    var linkEnabledColor = "";  
    if (this.props.url != "") {
      linkEnabledColor = "blue";
    }

    return (
      <Card color={linkEnabledColor} href={this.props.url} target='_blank'>
        <Card.Content>
          {/* <Image floated='left' avatar src={this.props.tweet.user.profile_image_url_https} /> */}
          <Card.Header style={{flex: 0}}>
            <Image floated='left' size='mini' avatar src={this.props.tweet.user.profile_image_url_https} />
            {at.concat(this.props.tweet.user.name)}
          </Card.Header>
          <Card.Description>{this.props.tweet.text}</Card.Description>
        </Card.Content>
        <Card.Content extra>
          <Icon name='user' />
          {this.props.tweet.user.followers_count}
        </Card.Content>
        {/* <Card.Content style={{flex: 0}} header={at.concat(this.props.tweet.user.name)} />
        <Card.Content description={this.props.tweet.text} />
        <Card.Content extra>
          <Icon name='user' />
          {this.props.tweet.user.followers_count}
        </Card.Content> */}
      </Card>
    );
  }
}


export default Test;
